iOS 5 Programming Pushing the Limits: Developing Extraordinary Mobile Apps for Apple iPhone, iPad, and iPod Touch (2nd edition) - 2010kaiser
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


Pushing the Limits with iOS 5 Programming is an expert guide for developers aiming to create unique applications for Apples iPad 2, iPhone, and the iPod Touch, which includes the latest version of the Apple iPhone SDK, iOS 5. This text goes beyond the basics to keep you ahead of the technology curve and spark your innovative nature to create seamless, functional, and fun apps. With a focus on advanced techniques for app development, you will learn to differentiate your apps from all the rest. With this must-have book, youll explore advanced coverage of a variety of development topics, such as developing with deep Objective-C, while you learn to create amazing applications for Apples iPad 2, iPhone, and iPod touch. Veteran mobile developers and authors guide you through maximizing your programs as they delve into topics not commonly found elsewhere.

Title: iOS 5 Programming Pushing the Limits: Developing Extraordinary Mobile Apps for Apple iPhone, iPad, and iPod Touch (2nd edition)
Author(s): Rob Napier, Mugunth Kumar
Publisher(s): John Wiley and Sons, Ltd.
Year: 2012
Format: PDF

